import React from "react";

export default function ListinReactExample() {
  const myList = ['Peter', 'Sachin', 'Kevin', 'Dhoni', 'Alisa'];
  const listItem = myList.map((name) => {
    return <li key={name}>{name}</li>;
  });

  return (
    <div>
      <ul>{listItem}</ul>
    </div>
  );
}
